import React, {useEffect} from 'react';
import {Link} from "react-router-dom"

function Main() {
    useEffect(()=> callBackendAPI()
        .then(res => this.setState({ data: res.express }))
        .catch(err => console.log(err)))


  return (
    <div>
      <h1>MainPage</h1>
      <Link to="/settings">Settings</Link>
    </div>
  );
}

export default Main;
